$(document).ready(function() {
    Webcam.set({
        width:320,
        height:420,
        image_format:'jpeg',
        jpeg_quality:90,
         
    });

    $('#accesscamera').on('click', function(){
        Webcam.reset();
        Webcam.on('error', function(){
            $('photomodal').modal('hide');
            swal({
                title : 'warning',
                text : 'please give access to camera',
                icon : 'warning'
            })
        });
        Webcam.attach('my_camera');
    });
    $('#takephoto').on('click',  take_snapshot);
    $('#retakephoto').on('click', function(){

      
        $('#my_camera').addClass('d-block');
        $('#my_camera').removeClass('d-none');
 
        $('#results').removeClass('d-block');
        $('#results').addClass('d-none');

        $('#takephoto').addClass('d-block');
        $('#takephoto').removeClass('d-none');

        $('#retakephoto').addClass('d-none');
        $('#retakephoto').removeClass('d-block');

        $('#uploadphoto').addClass('d-none');
        $('#uploadphoto').removeClass('d-block');
    });

    $('#photoForm').on('submit', function(e) {
       e.preventDefault();
       $.ajax({
           url: "photouploads.php",
           type : 'POST',
           data : new FormData(this),
           contentType : false,
           processData : false,
           success : function(data){
             
                     if(data == 'success'){
                         Webcam.reset();

                         $('#my_camera').addClass('d-block');
                         $('#my_camera').removeClass('d-none');

                         $('#results').addClass('d-none');

                         $('#takephoto').addClass('d-block');
                         $('#takephoto').removeClass('d-none');
                         
                         $('#retakephoto').addClass('d-none');
                         $('#retakephoto').removeClass('d-block');

                         $('#uploadphoto').addClass('d-none');
                         $('#uploadphoto').removeClass('d-block');

                         $('photomodal').modal('hide');

                         swal({
                             title: 'success',
                             text: 'photo uploaded successfully',
                             icon: 'success',
                             button: false,
                             closeOnClickOutside : false,
                             closeOnEsc: false,
                             timer: 2000
                         })
                     }
                     else{
                         
                        swal({
                            title: 'error',
                            text: 'Something went wrong',
                            icon: 'error',
                            
                        })
                     }
           }
       })
    })

})

function take_snapshot(){
    //Take snapshot and get image data
    Webcam.snap(function(data_uri){
        //display Result image
        $('#results').html('<img src="' + data_uri + '" class="d-block mx-auto rounded"/>');
        var raw_image_data = data_uri.replace(/^data\:image\/\w+\;base64\,/, '');
      $('#photoStore').val(raw_image_data);

    });
    $('#my_camera').removeClass('d-block');
    $('#my_camera').addClass('d-none');

    $('#results').removeClass('d-none');
    
    $('#takephoto').removeClass('d-block');
    $('#takephoto').addClass('d-none');

    $('#retakephoto').removeClass('d-none');
    $('#retakephoto').addClass('d-block');

    $('#uploadphoto').removeClass('d-none');
    $('#uploadphoto').addClass('d-block');

}

// For todays date;
Date.prototype.today = function () { 
    return ((this.getDate() < 10)?"0":"") + this.getDate() +"/"+(((this.getMonth()+1) < 10)?"0":"") +
     (this.getMonth()+1) +"/"+ this.getFullYear();
}

// For the time now
Date.prototype.timeNow = function () {
     return ((this.getHours() < 10)?"0":"") + this.getHours() +":"+ ((this.getMinutes() < 10)?"0":"") +
      this.getMinutes() +":"+ ((this.getSeconds() < 10)?"0":"") + this.getSeconds();
}

var datetime =   new Date().today()+'@'+new Date().timeNow() + ".jpeg " ;
console.log(datetime);

 